    boxNumber = 4;
  } else if ((row >= 3 && row < 6) && (column >= 6 && column < 9)){
    boxNumber = 5;
  } else if ((row >=6 && row < 9) && column < 3) {
    boxNumber = 6;
  } else if ((row >= 6 && row < 9) && (column >= 3 && column < 6)){
    boxNumber = 7;
  } else if ((row >= 6 && row < 9) && (column >=6 && column < 9)){
